// frontend/src/components/dashboard/Dashboard.js
import React from 'react';

// Dummy data până când conectăm cu backend-ul
const dummyActivities = [
   { description: 'Salariu nou creat', time: '09.12.2024', user: 'Admin User' },
   { description: 'Adăugare diurnă', time: '09.12.2024', user: 'Admin User' },
   { description: 'Nouă perioadă adăugată: Plecat', time: '09.12.2024', user: 'Admin User' },
   { description: 'Concediu nou creat', time: '09.12.2024', user: 'Admin User' }
];

const dummyDocuments = [
   { name: 'RCA', type: 'Vehicle', expiryDate: '15.01.2025', status: 'warning' },
   { name: 'ITP', type: 'Vehicle', expiryDate: '20.02.2025', status: 'warning' },
   { name: 'Fișă Medicală', type: 'Driver', expiryDate: '10.01.2025', status: 'expired' }
];

const dummyDrivers = [
   { name: 'Ion Popescu', vehicle: 'B-123-ABC', status: 'active', statusText: 'Activ' },
   { name: 'George Ionescu', vehicle: 'B-456-DEF', status: 'active', statusText: 'Activ' },
   { name: 'Vasile Marin', vehicle: 'Neasignat', status: 'holiday', statusText: 'Concediu' }
];

const Dashboard = () => {
   return (
       <div className="space-y-6">
           <h1 className="text-2xl font-bold text-gray-900">Dashboard</h1>
           
           {/* Stats Cards */}
           <div className="grid grid-cols-1 md:grid-cols-4 gap-6">
               <StatsCard
                   title="Total Șoferi"
                   value="3"
                   trend="+2"
                   icon={
                       <div className="bg-blue-100 p-3 rounded-full">
                           <svg className="w-6 h-6 text-blue-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                               <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M17 20h5v-2a3 3 0 00-5.356-1.857M17 20H7m10 0v-2c0-.656-.126-1.283-.356-1.857M7 20H2v-2a3 3 0 015.356-1.857M7 20v-2c0-.656.126-1.283.356-1.857m0 0a5.002 5.002 0 019.288 0M15 7a3 3 0 11-6 0 3 3 0 016 0zm6 3a2 2 0 11-4 0 2 2 0 014 0zM7 10a2 2 0 11-4 0 2 2 0 014 0z" />
                           </svg>
                       </div>
                   }
               />
               <StatsCard
                   title="Șoferi Activi"
                   value="2"
                   trend="+1"
                   icon={
                       <div className="bg-green-100 p-3 rounded-full">
                           <svg className="w-6 h-6 text-green-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                               <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M9 12l2 2 4-4m6 2a9 9 0 11-18 0 9 9 0 0118 0z" />
                           </svg>
                       </div>
                   }
               />
               <StatsCard
                   title="În Concediu"
                   value="0"
                   trend="0"
                   icon={
                       <div className="bg-yellow-100 p-3 rounded-full">
                           <svg className="w-6 h-6 text-yellow-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                               <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M12 8v4l3 3m6-3a9 9 0 11-18 0 9 9 0 0118 0z" />
                           </svg>
                       </div>
                   }
               />
               <StatsCard
                   title="Total Vehicule"
                   value="2"
                   trend="+1"
                   icon={
                       <div className="bg-purple-100 p-3 rounded-full">
                           <svg className="w-6 h-6 text-purple-600" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                               <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M8 16H6a2 2 0 01-2-2V6a2 2 0 012-2h8a2 2 0 012 2v2m-6 12h8a2 2 0 002-2v-8a2 2 0 00-2-2h-8a2 2 0 00-2 2v8a2 2 0 002 2z" />
                           </svg>
                       </div>
                   }
               />
           </div>

           {/* Main Content */}
           <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
               {/* Activity Feed */}
               <div className="bg-white rounded-lg shadow">
                   <div className="p-6">
                       <h2 className="text-lg font-semibold text-gray-900 mb-4">Activitate Recentă</h2>
                       <ActivityList activities={dummyActivities} />
                   </div>
               </div>

               {/* Expiring Documents */}
               <div className="bg-white rounded-lg shadow">
                   <div className="p-6">
                       <h2 className="text-lg font-semibold text-gray-900 mb-4">Documente care Expiră</h2>
                       <DocumentsList documents={dummyDocuments} />
                   </div>
               </div>
           </div>

           {/* Driver Status */}
           <div className="bg-white rounded-lg shadow">
               <div className="p-6">
                   <h2 className="text-lg font-semibold text-gray-900 mb-4">Status Șoferi</h2>
                   <DriverList drivers={dummyDrivers} />
               </div>
           </div>
       </div>
   );
};

// Stats Card Component
const StatsCard = ({ title, value, trend, icon }) => (
   <div className="bg-white rounded-lg shadow p-6">
       <div className="flex items-center justify-between">
           <div className="flex-1">
               <h3 className="text-sm font-medium text-gray-500">{title}</h3>
               <div className="mt-2 flex items-baseline">
                   <p className="text-2xl font-semibold text-gray-900">{value}</p>
                   {trend && (
                       <span className={`ml-2 text-sm font-medium ${
                           trend.startsWith('+') ? 'text-green-600' : 
                           trend.startsWith('-') ? 'text-red-600' : 
                           'text-gray-500'
                       }`}>
                           {trend}
                       </span>
                   )}
               </div>
           </div>
           {icon}
       </div>
   </div>
);

// Activity List Component
const ActivityList = ({ activities }) => (
   <div className="space-y-4">
       {activities.map((activity, index) => (
           <div key={index} className="flex space-x-3 pb-4 border-b border-gray-200 last:border-0">
               <div className="flex-1">
                   <p className="text-sm text-gray-900">{activity.description}</p>
                   <div className="mt-1 flex items-center space-x-2">
                       <span className="text-xs text-gray-500">{activity.time}</span>
                       <span className="text-xs text-gray-500">{activity.user}</span>
                   </div>
               </div>
           </div>
       ))}
   </div>
);

// Documents List Component
const DocumentsList = ({ documents }) => (
   <div className="space-y-4">
       {documents.map((doc, index) => (
           <div key={index} className="flex justify-between items-center pb-4 border-b border-gray-200 last:border-0">
               <div>
                   <p className="text-sm font-medium text-gray-900">{doc.name}</p>
                   <p className="text-xs text-gray-500">{doc.type}</p>
               </div>
               <div className="text-right">
                   <p className={`text-sm font-medium ${
                       doc.status === 'expired' ? 'text-red-600' : 'text-yellow-600'
                   }`}>
                       {doc.expiryDate}
                   </p>
               </div>
           </div>
       ))}
   </div>
);

// Driver List Component
const DriverList = ({ drivers }) => (
   <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
       {drivers.map((driver, index) => (
           <div key={index} className="bg-gray-50 rounded-lg p-4">
               <div className="flex justify-between items-start">
                   <div>
                       <h4 className="text-sm font-medium text-gray-900">{driver.name}</h4>
                       <p className="text-xs text-gray-500">{driver.vehicle}</p>
                   </div>
                   <span className={`px-2 py-1 text-xs rounded-full ${
                       driver.status === 'active' ? 'bg-green-100 text-green-800' :
                       driver.status === 'holiday' ? 'bg-yellow-100 text-yellow-800' :
                       'bg-gray-100 text-gray-800'
                   }`}>
                       {driver.statusText}
                   </span>
               </div>
           </div>
       ))}
   </div>
);

export default Dashboard;
